.set_grid_type {
  height 30px;
  font-size 12px;
  line-height 30px;
  padding 0 30px;
  margin-bottom 10px;
  >span {
    margin-right 30px;
    float left;
    cursor: pointer;
  }
  p {
    float right;
  }
}
  .mr-text {
    margin-right 10px;
  }
  .trade-box.trade-box-ex-container .trade-grid .top-mag .lov {
    display: flex;
    align-items: center;
    height: 42px;
    line-height: 16px;
    justify-content: center;
  }
  .trade-box.trade-box-ex-container .trade-grid .top-mag .lov .lovText {
    vertical-align: middle;
    line-height: 16px;
    display: inline-block;
    word-wrap: break-word;
  }
  .trade-box.trade-box-ex-container .trade-grid .top-mag {
    height: 42px;
    line-height: 42px;
  }
  .input-inline-box {
    display flex;
    align-items: center;
    justify-content space-between;
    .input-inline-item {
      flex 1;
    }
    >b {
      display inline-block;
      width 10px;
      margin 0 9px;
      border-bottom-width 2px;
      border-bottom-style solid;
      position relative;
      top -2px;
    }
  }
  .set-type {
    margin-bottom: 6px;
  }
  .set-type-btn {
    cursor pointer;
    height 35px;
    display inline-block;
    width 45%;
    border-radius: 2px;
    border-width: 1px;
    border-style: solid;
    margin-right 5%;
    box-sizing border-box;
    float left;
    line-height 35px;
    text-align center;
  }
  .set-type-btn:nth-child(2) {
    float right;
    margin-right 0;
  }
  .set-num {
    margin-top 14px;
    .setn-num-list {
      width 33.33%;
      float left;
      padding-right 10px;
      box-sizing: border-box;
      .trade-input.trade-input-china-container .input-item {
        padding 8px 10px 0 15px;
        .inputs {
          width 62%;
        }
        .units {
          right 10px;
        }
      }
    }
    .setn-num-list:last-child {
      padding-right 0;
    }
  }
  .set-btc {
    margin-bottom 10px;
  }
  .switch-inline {
    margin-left 40px;
    display inline-block;
    vertical-align: middle;
  }
  .fee_love {
    display flex;
    justify-content space-between;
    align-items center;
    width: 100%;
    label {
      display: flex;
      align-items: center;
      >span {
        font-size: 16px;
        line-height 16px;
      }
    }
  }
  .en_US .trade-box.trade-box-ex-container .trade-grid .top-mag {
    margin-bottom 2px;
  }

  .header-title {
    display: flex;
    align-items: center;
    justify-content: space-between;
  }

  .trade-block {
    height: 430px;
    background-color: #fff;
    border-radius: 10px;
    margin-top: 29px;
    padding: 18px 24px 16px 25px;
    box-sizing: border-box;
    &:first-child {
      margin-right: 10px;
    }
    &:last-child {
      margin-left: 10px;
    }
    .top-mag {
      margin-bottom: 16px;
    }
    .trade-type {
      font-size: 16px;
      font-weight: 600;
      color: RGB(22, 22, 31);
    }
  }
  .trade-box.trade-box-ex-container .trade-form {
    .percentage {
      margin: 0;
      .per-item {
        height: 20px;
        line-height: 20px;
        border: 1px solid rgba(167, 180, 203, .3);
        color: #A7B4CB;
        margin-left: 0;
        margin-right: 10px;
        &:last-child {
          margin-right: 0;
        }
      }
    }
    .volume-trade {
      height: 59px;
      line-height: 59px;
      div {
        color: #16161F;
        font-size: 14px;
        font-weight: 600;
      }
    }
    .common-button {
      height: 56px;
      border-radius: 10px;
      background-color: RGB(18, 105, 255);
    }
  }
